import React,{useState,useEffect} from "react";
import { useNavigate } from "react-router";
import { useSearchParams } from "react-router-dom";


const SearchPage = ({fetchUsersByName}) => {
    // const [searchQuery] = useSearchParams;
    const query = searchQuery.get("query") || "";
    const [results,setResults] = useState([]);

    const [params] = useSearchParams();
    const firstName = params.get('first_name') || '';
    const lastName = params.get('last_name') || '';

    useEffect(() => {
      if (firstName) {
        fetchUsersByName(firstName, lastName)
          .then(setResults)
          .catch(console.error);
      }
    }, [firstName, lastName]);

      return (
        <>
        <div>
            {results.map((result) => (
                <li key={result.user_id} className="home-search-result-list">
                <button className="home-search-result-list-button"><p>{result.first_name} {result.last_name}</p></button>
                </li>
            ))}
        </div>
        </>
      )
}

export default SearchPage;
